/* eslint-disable jsx-a11y/alt-text */
import React from "react";
import Slider from "react-slick";

const Product = () => {
  const settings = {
    dots: true,
    dotsClass: "slick-dots slick-thumb",
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <Slider {...settings}>
      <div>
        <img
          src={
            "https://lumen.thinkpro.vn//backend/uploads/product/avatar/2021/8/31/hp-340s-g7-thinkpro-thumbnailjpg"
          }
        />
      </div>
      <div>
        <img
          src={
            "https://lumen.thinkpro.vn//backend/uploads/product/avatar/2021/8/31/hp-340s-g7-thinkpro-thumbnailjpg"
          }
        />
      </div>
      <div>
        <img
          src={
            "https://lumen.thinkpro.vn//backend/uploads/product/avatar/2021/8/31/hp-340s-g7-thinkpro-thumbnailjpg"
          }
        />
      </div>
      <div>
        <img
          src={
            "https://lumen.thinkpro.vn//backend/uploads/product/avatar/2021/8/31/hp-340s-g7-thinkpro-thumbnailjpg"
          }
        />
      </div>
    </Slider>
  );
};
export default Product;
